import React from "react";
import "../../style/style.css";

const ResultItem = (props) => {
  return (
    <div>
      <div className="attackers__row--add">{props.playerName}</div>
      <div className="attackers__row--add">{props.playerNumber}</div>
    </div>
  );
};

export default ResultItem;
